DROP DATABASE IF EXISTS paris_resto;
create database paris_resto character set utf8 COLLATE utf8_general_ci;
USE paris_resto;

CREATE TABLE categories(
        id  Int NOT NULL ,
        nom Varchar (50) NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE commentaires(
        id             Int NOT NULL ,
        titre          Varchar (50) ,
        description    Varchar (1024) ,
        date_insertion Date NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE listenotes(
        id Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE avis(
        actif           Bool ,
        id_restaurant  Int NOT NULL ,
        id_user        Int NOT NULL ,
        id_commentaire Int NOT NULL ,
        id_listenote   Int NOT NULL ,
        PRIMARY KEY (id_restaurant ,id_user ,id_commentaire ,id_listenote )
)ENGINE=InnoDB;


CREATE TABLE notes(
        id                Int NOT NULL ,
        valeur            Int NOT NULL ,
        id_listenotes     Int NOT NULL ,
        id_categorie_note Int NOT NULL ,
        PRIMARY KEY (id ,id_listenotes )
)ENGINE=InnoDB;


CREATE TABLE photos(
        id             Int NOT NULL ,
        nom_fichier    Varchar (50) NOT NULL ,
        date_insertion Date NOT NULL ,
        id_restaurant Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE restaurants(
        id            Int NOT NULL ,
        nom           Varchar (50) NOT NULL ,
        numero_tel    Varchar (20) ,
        email         Varchar (50) ,
        numero_voie   Numeric ,
		    type_voie Varchar(20) ,
		    nom_voie      Varchar (50) ,
        date_insertion Date NOT NULL ,
        description    Varchar (1000) ,
        prix           Varchar (50) ,
        horraires      Varchar (50) ,
    		id_ville     Int (11) unsigned DEFAULT NULL,
        id_user       Int ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE statuts(
        id  Int NOT NULL ,
        nom Varchar (50) NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE categories_note(
        id  Int NOT NULL ,
        nom Varchar (20) NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE types_voie(
        id  Int NOT NULL ,
        nom Varchar (50) NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


CREATE TABLE users(
        id               Int(11) unsigned NOT NULL ,
        pseudo           Varchar (100) NOT NULL ,
        email            Varchar (100) NOT NULL ,
        mdp              Varchar (100) NOT NULL ,
        date_inscription Date NOT NULL ,
        email_check      Varchar (100) NOT NULL ,
        actif            Bool NOT NULL ,
        commentaire      Varchar (1000) NOT NULL ,
        statut           Varchar (20) ,
        PRIMARY KEY (id ) ,
        INDEX (email )
)ENGINE=InnoDB;


CREATE TABLE ligcategories(
        id_restaurant Int NOT NULL ,
        id_categorie  Int NOT NULL ,
        PRIMARY KEY (id_restaurant ,id_categorie )
)ENGINE=InnoDB;


CREATE TABLE `villes` (
   id  int (11) unsigned Auto_increment  NOT NULL ,
  `nom` varchar(255) NOT NULL default '',
  `cp` varchar(255) NOT NULL default '',
  `latitude` float(7,6) NOT NULL default '0.000000',
  `longitude` float(7,6) NOT NULL default '0.000000',
  `eloignement` varchar(255) NOT NULL default '',
  `url` varchar(255) NOT NULL default '',
  PRIMARY KEY (id)
) ENGINE=InnoDB;


